import React from 'react';
import { NavLink } from 'react-router-dom';

export const Home = (props) => {
    return (
        <>
          
          <h1>I'm Home</h1>  
          <NavLink exact activeClassName='' to='/'>Home</NavLink>
          <NavLink to='./About'>About</NavLink>
          <NavLink to='./Contact'>Contact</NavLink>
        </ >
       
    )
}

export default Home;
